import React from 'react';
import { FaBriefcase, FaChartLine, FaPlusCircle } from 'react-icons/fa';
import styled from 'styled-components';

const NavbarContainer = styled.div`
    display: flex;
    justify-content: space-between;
    align-items: center;
    background-color: #333;
    padding: 10px 20px;
    color: white;
`;

const Logo = styled.div`
    font-size: 24px;
    font-weight: bold;
`;

const NavIcons = styled.div`
    display: flex;
    gap: 20px;
`;

const Icon = styled.div`
    cursor: pointer;
    font-size: 20px;
`;

const CompanyName = styled.div`
    font-size: 20px;
`;

const Navbar = () => {
    return (
        <NavbarContainer>
            <Logo>Logo</Logo>
            <NavIcons>
                <Icon><FaBriefcase title="Jobs" /></Icon>
                <Icon><FaChartLine title="Progress" /></Icon>
                <Icon><FaPlusCircle title="Create Job" /></Icon>
            </NavIcons>
            <CompanyName>Grey</CompanyName>
        </NavbarContainer>
    );
};

export default Navbar;
